import React, { useState, useEffect } from 'react';
import weatherService from '../services/weather.service';
import '../styles/Weather.css';

const Weather = () => {
  const [weather, setWeather] = useState(null);
  const [forecast, setForecast] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchWeatherData = async () => {
      try {
        setLoading(true);
        const [currentWeather, forecastData] = await Promise.all([
          weatherService.getCurrentWeather(),
          weatherService.getForecast()
        ]);
        
        setWeather(currentWeather);
        setForecast(forecastData);
        setError(null);
      } catch (err) {
        setError('Failed to load weather data');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchWeatherData();
  }, []);

  if (loading) {
    return <div className="weather-loading">Loading weather data...</div>;
  }

  if (error) {
    return <div className="weather-error">{error}</div>;
  }

  if (!weather || !forecast) {
    return null;
  }

  return (
    <div className="weather-widget">
      <div className="current-weather">
        <div className="weather-header">
          <h3>{weather.location.name}</h3>
          <p>{weather.location.country}</p>
        </div>
        <div className="weather-info">
          <img 
            src={weather.current.condition.icon} 
            alt={weather.current.condition.text}
          />
          <div className="temperature">
            <span className="temp">{weather.current.temp_c}°C</span>
            <span className="condition">{weather.current.condition.text}</span>
          </div>
        </div>
        <div className="weather-details">
          <div className="detail">
            <span>Humidity</span>
            <span>{weather.current.humidity}%</span>
          </div>
          <div className="detail">
            <span>Wind</span>
            <span>{weather.current.wind_kph} km/h</span>
          </div>
          <div className="detail">
            <span>Feels like</span>
            <span>{weather.current.feelslike_c}°C</span>
          </div>
        </div>
      </div>
      
      <div className="forecast">
        {forecast.forecast.forecastday.map((day) => (
          <div key={day.date} className="forecast-day">
            <span className="date">
              {new Date(day.date).toLocaleDateString('en-US', { weekday: 'short' })}
            </span>
            <img 
              src={day.day.condition.icon} 
              alt={day.day.condition.text}
            />
            <div className="forecast-temps">
              <span className="max">{Math.round(day.day.maxtemp_c)}°</span>
              <span className="min">{Math.round(day.day.mintemp_c)}°</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Weather;
